import { useState } from "react";

const AddPostForm = () => {
    const [label, setLabel] = useState('')

    const onLabelChange = (event: any) => {
        setLabel(event.target.value)
    }

    const onSubmit = (event: any) => {
        event.preventDefault()
        this.props.addPost()
    }
}

export default AddPostForm
